import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

function EventoView() {
  const { id } = useParams();

  useEffect(() => {
    console.log('Entre al useEffect');
    console.log(id);

    fetch(`http://localhost:3333/api/eventos/${id}`)
      .then(res => res.json())
      .then(data => console.log(data))
  }, []);


  return (
    <div>
      <h1>EventoView</h1>
      <p>Hola {id}</p>
    </div>
  );
}

export default EventoView;
